 *   return response;
 * };
 *
 * testRunner.registerFunction('get-response', handler);
 *
 * // Chain multiple registrations
 * testRunner
 *   .registerFunction('workflow-a', workflowAHandler)
 *   .registerFunction('workflow-b', workflowBHandler)
 * ```
 *
 */

