 * This method should be called between test runs to ensure a clean state. It clears the operation index, wait manager, and operation storage, allowing the runner to be reused for multiple test executions.
 *
 * @example
 * ```typescript
 * beforeEach(() => {
 *   runner.reset();
 * });
